import Pad from "./Pad";
import { pads } from "../data";

export default function Pads() {
  const padsMapped = pads.map((pad, key) => {
    return <Pad />;
  });

  return(
    <section className="pad-area">
        <div className="pads-description">
            <select name="hat">
                <option value="1">hat-1</option>
                <option value="1">hat-2</option>
                <option value="1">hat-3</option>
            </select>
            <select name="bass">
                <option value="1">bass-1</option>
                <option value="1">bass-2</option>
                <option value="1">bass-3</option>
            </select>
            <select name="drum">
                <option value="1">hat-1</option>
                <option value="1">hat-2</option>
                <option value="1">hat-3</option>
            </select>
        </div>
        <div className="pads-container">
            {padsMapped}
        </div>
    </section>
  )
}
